import React, { Component } from 'react';
import "../css/components/navbar.css";



const Navbar = () => {
    return ( 
        // <nav className="navbar navbar-expand-lg navbar-light bg-light" id="home-navbar">
        //     <a className="navbar-brand" href="#">Qlick2Learn</a>
        //     <button className="navbar-toggler" type="button" data-toggle="collapse" data-target=".navbarContentdemo1" >
        //         <span className="navbar-toggler-icon"></span>
        //     </button>
        //     <div className="collapse navbar-collapse justify-content-between navbarContentdemo1">
        //         <ul className="navbar-nav">
        //             <li><a className="nav-item nav-link" href="#">Courses</a></li>
        //             <li><a className="nav-item nav-link" href="#">News</a></li>
        //             <li><a className="nav-item nav-link" href="#">Find an Expert</a></li>
        //             <li><a className="nav-item nav-link" href="#">Contact Us</a></li>
        //         </ul>
        //         <div className="">
        //             <span></span>
        //             <a className="navbar-nav nav-item nav-link" href="#">My Account</a>
        //         </div>
        //     </div>
        // </nav>
        
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <a class="navbar-brand" href="#">Navbar</a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav mr-auto">
            <li class="nav-item active">
                <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#">Link</a>
            </li>
            <li class="nav-item dropdown">
                <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                Dropdown
                </a>
                <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                <a class="dropdown-item" href="#">Action</a>
                <a class="dropdown-item" href="#">Another action</a>
                <div class="dropdown-divider"></div>
                <a class="dropdown-item" href="#">Something else here</a>
                </div>
            </li>
            <li class="nav-item">
                <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
            </li>
            </ul>
        </div>
        </nav>
        );
}
 
export default Navbar;
